import React from "react";
import Login from "./Components/Seguridad/Login";
import theme from "./theme/theme";
import { ThemeProvider } from "@material-ui/core";

function App() {
  return (
   <div className="App">
      {/* <header className="App-header">
          <span>Test Code</span>
      </header> */}
      <ThemeProvider theme={theme}>
        <Login/>
      </ThemeProvider>
   </div>
  );
}

export default App;
